import React from 'react';
import { Link } from 'react-router-dom';

const AdminDashboard = () => {
  return (
    <div className="dashboard">
      <h1>Admin Dashboard</h1>

      <div className="card">
        <h3>Member</h3>
        <p>Manage and view members' details.</p>
        <Link to="/MemberView" className="button">
          Click Here
        </Link>
      </div>

      <div className="card">
        <h3>Medical Bill</h3>
        <p>View and manage medical bills.</p>
        <Link to="/MedicalBillView" className="button">
          
        </Link>
      </div>
    </div>
  );
};

export default AdminDashboard;
